import React from 'react';
import { useParams,useLocation,useHistory } from 'react-router-dom';

const Sec = ({match}) => {
    var { name,id } = useParams()
    var x = useLocation()
    return (
        <h1>This is body { name } { id } {x.pathname}</h1>
    )
}

export default Sec;
